  if (h) {
    var rc = (/.co.uk$/.test(h) || /.com.br$/.test(h) || /.com.au$/.test(h) || /.co.nz$/.test(h) ) ? 3 : 2;
    var ha = h.split('.');
    var rda = ha.slice(ha.length - rc);
    if (rda.length > 1) {
      var rd = rda.join('.');
      cookie += ' Domain=' + rd + ';';
    }
  }
}
document.cookie = cookie;

